import React from 'react'
import styled from 'styled-components'

const AppIconContainerStyles = styled.div`
  margin-right: 5px
`

export const AppIconContainer = ({ children }) => (
  <AppIconContainerStyles>
    { children }
  </AppIconContainerStyles>
)
